import {
    OwpTextField,
    OwpButton,
    OwpSelectField,
    OwpDialog,
    OwpMessage,
    OwpTreeGrid,
    OwpSearchDateTimePickerMulti,
    OwpDateTimePicker,
} from 'owp/wrapper';
import React, { Component } from 'react';
import Formsy from 'formsy-react';
import { mutate } from 'owp/api';
import * as TGEvent from 'owp/TGEvent';

class DialogReweighing extends Component {
    constructor(props) {
        super(props);
        this.owpDialog = React.createRef();
        this.clickCreate = this.clickCreate.bind(this);
        this.onSave = this.onSave.bind(this);
        this.state = {
            FLAG: 'Y',
        };
    }

    handleChange = (event) => {
        this.setState({ [event.target.name]: event.target.value });
    };

    

    // 등록 화면 닫기
    createDialogClose = () => {
        this.setState({ createDialogOpen: false });
        this.owpDialog.handleClose();
    };

    // 등록 확인 화면 열기
    createCheckOpen = () => {

        this.setState({ createCheckOpen: true });
        this.setState({ popMessage: '수정하시겠습니까?' });
    };

    // 등록 확인 화면 닫기
    createCheckClose = () => {
        this.setState({ createCheckOpen: false });
    };

    onSave = async (type) => {
        const data = {
            cudtype: 'create',
            
        };

        const result = await mutate({
            url: '/createIpxCommoncode',
            data,
        })
            
    };

    clickCreate() {
        this.onSave('START');
    }

    render() {
        return (
            <OwpDialog
                title={
                    <div className="pt-0 mt-0 pb-0 mb-0 w-full flex justify-between items-center">
                        공정 수정
                    </div>
                }

                callbackFunction={this.createDialogOpen}
                dialogButton="수정"
                dialogActions={
                    <React.Fragment>
                        <div className="w-full center">
                            <OwpButton color="secondary" variant="contained" onClick={this.createCheckOpen}>
                                수정
                            </OwpButton>
                            <OwpButton color="secondary" variant="outlined" onClick={this.createDialogClose}>
                                취소
                            </OwpButton>
                        </div>
                    </React.Fragment>
                }
                innerRef={(ref) => (this.owpDialog = ref)}
                width="1100px"
                height="auto"
            >
                <React.Fragment>
                    <div style={{width:'100%'}}>
                        <div>
                            <table className="table table-bordered table-advance tlw5">
                                <tbody>
                                <tr>
                                    <th className="left b" width="150">대공정명</th>
                                    <td>
                                        <OwpTextField
                                            style={{ width: '100%' }}
                                            id={''}
                                            name={''}
                                            value="원료 및 장비준비"
                                            withTable={false}
                                            disabled={false}
                                            className="mg0"
                                        />
                                    </td>
                                    <th className="left b" width="150">소공정명</th>
                                    <td>
                                    <OwpTextField
                                            style={{ width: '100%' }}
                                            id={''}
                                            name={''}
                                            value="장비확인"
                                            withTable={false}
                                            disabled={false}
                                        />
                                    </td>
                                </tr>
                                </tbody>
                            </table>
                        </div>
                        
                        <div>
                            <textarea
                                className="t_textarea"
                                style={{height:'500px'}}>
사용 예정 장비의 상태를 확인한다.

1) R1/R2/FD 내부 세척 / 건조 상태 확인 ( )
        
                            </textarea>
                        </div>
                    </div>
                </React.Fragment>
            </OwpDialog>
        );
    }
}

export default DialogReweighing;
